const AES = {
    genKeys: () => {
        key = forge.random.getBytesSync(32)
        iv = forge.random.getBytesSync(32)
        return new ByteStringBuffer(key).toHex() +'/'+ new ByteStringBuffer(iv).toHex()
    },

    cipher: (content, keys, password) => {
        ks = keys.split('/')
        if(password)
            ks[0] = keccak256(ks[0] + password).toString('hex')
        key = forge.util.hexToBytes(ks[0])
        iv = forge.util.hexToBytes(ks[1])

        var cipher = forge.cipher.createCipher('AES-CBC', key);

        var buf = new ByteStringBuffer(content)
        cipher.start({iv: iv})
        cipher.update(forge.util.createBuffer(buf))
        cipher.finish()

        return cipher.output.toHex()
    },

    decipher: (content, keys, password) => {
        ks = keys.split('/')
        if(password)
            ks[0] = keccak256(ks[0] + password).toString('hex')
        key = forge.util.hexToBytes(ks[0])
        iv = forge.util.hexToBytes(ks[1])
        content = forge.util.hexToBytes(content)

        var decipher = forge.cipher.createDecipher('AES-CBC', key);

        var buf = new ByteStringBuffer(content)
        decipher.start({iv: iv});
        decipher.update(buf);
        decipher.finish();

        return decipher.output.toString()
    }
}